0556-5999972', '2025-01-24 00:00:00', 'https://wanyi.etrading.cn/', 60000.00, '安庆市经开区检验检查互认和公卫慢阻肺功能升级项目已经招标公示，项目于 2025年1月23日截止报名，2025年1月24日8时30分在线开标。现在申请协调报名投标流程，项目先登录系统报名根据需求进行报价，不需要写详细方案。主要内容如下：
（一）安徽省检验检查互认开发对接需求
1、完成基层医疗机构医疗管理系统HIS与安庆市检查检验结果互认组件的对接升级改造，实现公立医疗机构医生工作站调阅功能。
2、依托经开区区域LIS系统完成区域检验结果数据上传至市级全民健康信息平台，并根据市级接口规范，确保患者信息登记准确、完整。
（二）基本公共卫生系统升级改造慢阻肺功能
根据安徽省《慢性阻塞性肺疾病患 者健康服务规范（试行）》，对原有基本公共卫生服务信息系统进行改造，增加慢阻肺病患者健康服务内容，实现服务数据的录入和相关评价指标的自动计算，并在改造完成后按照家庭医生签约服务信息系统相关要求定期上传数据。


